import React from "react";

function TopButtons() {
  const cities = [
    {
      id: 1,
      title: "London",
    },
    {
      id: 2,
      title: "Sydney",
    },
    {
      id: 3,
      title: "New York",
    },
    {
      id: 4,
      title: "Auckland",
      long: "36.8509",
      lat: "174.7645",
    },
    {
      id: 5,
      title: "Tokyo",
    },
  ];

  const handleSubmit = (city) => {
    console.log("This worked");
  };
  return (
    <div className="top-button">
      {cities.map((city) => (
        <button
          key={city.id}
          onClick={() => {
            handleSubmit(city);
          }}
        >
          {city.title}
        </button>
      ))}
    </div>
  );
}

export default TopButtons;
